import React, { Component } from "react";
import { Col, Row, Container } from "../components/Grid";
import background from "../images/floor2.jpg";
import { Link } from "react-router-dom";
import InstructorProfileSurvey from "../components/InstructorProfileForm/InstructorProfileForm";

// on click to store the survey to the db
// on click View Profile store the name data or redirect to the new page with the obj?
// load page

class InstructorProfile extends Component {
  // state = {
  //   selection: ""
  // };

  // handleViewProfile = (event) => {
  //   this.setState({ selection: event.target.value, name: , id: ,
  //   })
  // }

  render() {
    return (
      <div>
        <div className="parallax-container">
          <Container>
            <Row>
              <InstructorProfileSurvey />
            </Row>
            <Row>
              <Link to="/booking">
                {" "}
                <a className="waves-effect waves-light btn-small">
                  View Profile Page
                </a>{" "}
              </Link>
            </Row>
          </Container>
          <div className="parallax">
            <img
              className="background"
              src={background}
              alt="Unsplashed background img 1"
            />
          </div>
        </div>
        <div className="section-white">
          <h2 className="center">Namaste</h2>
          <Row>
            <div className="center">
              <Col size="3" />
            </div>
            <div className="center">
              <Col size="6">
                <p>
                  "Yoga is a light which once lit will never dim, the better
                  your practice the brighter your flame."
                </p>
                <p>- B.K.S. Iyengar</p>
              </Col>
            </div>
            <div className="center">
              <Col size="3" />
            </div>
          </Row>
        </div>
      </div>
    );
  }
}

export default InstructorProfile;
